oxy_webhelp_navlinks = {"further_with_plugin-d895e699":{"topics":[{"title":"6.1.2.1 使用翻译插件进行阅读","shortdesc":"<p class=\"shortdesc\">翻译插件可在Zotero中实现对于可识别文档的快速翻译，极大提高阅读效率（<a class=\"xref\" href=\"6%E6%96%87%E7%8C%AE%E9%98%85%E8%AF%BB%E4%B8%8E%E5%BC%95%E7%94%A8\/add_translationplugin.html\">插件安装<\/a>）。<\/p>","href":"6文献阅读与引用\/trans_use.html","attributes":{"data-id":"trans_use"},"menu":{"hasChildren":false},"tocID":"trans_use-d895e710","topics":[]},{"title":"6.1.2.2 使用标签插件进行阅读","shortdesc":"<p class=\"shortdesc\">通过标签插件可在Zotero中对于文库中的文献条目进行显著的标记，更大限度地提高对于文献的分类管理（<a class=\"xref\" href=\"6%E6%96%87%E7%8C%AE%E9%98%85%E8%AF%BB%E4%B8%8E%E5%BC%95%E7%94%A8\/add_tagsplugin.html\">插件安装<\/a>）。<\/p>","href":"6文献阅读与引用\/tags_use.html","attributes":{"data-id":"tags_use"},"menu":{"hasChildren":false},"tocID":"tags_use-d895e724","topics":[]},{"title":"6.1.2.3 使用参考文献提取插件进行阅读","shortdesc":"<p class=\"shortdesc\">参考文献提取插件可为您提取正在阅读中的文献的参考文献条目，进行延伸阅读，提高您的学术研究效率（<a class=\"xref\" href=\"6%E6%96%87%E7%8C%AE%E9%98%85%E8%AF%BB%E4%B8%8E%E5%BC%95%E7%94%A8\/add_referenceplug.html\">插件安装<\/a>）。<\/p>","href":"6文献阅读与引用\/reference_use.html","attributes":{"data-id":"reference_use"},"menu":{"hasChildren":false},"tocID":"reference_use-d895e738","topics":[]},{"title":"6.1.2.4 使用风格插件提高阅读效率","shortdesc":"<p class=\"shortdesc\">Zotero只能提供已经导入的文件的文件名等基础信息，对于作者、年份、文献所属期刊等级、影响因子等则无法提供；通过Ethereal             Style插件则可以实现上述功能，提高文献管理和阅读效率（<a class=\"xref\" href=\"6%E6%96%87%E7%8C%AE%E9%98%85%E8%AF%BB%E4%B8%8E%E5%BC%95%E7%94%A8\/add_ethereal.html\">插件安装跳转<\/a>）。<\/p>","href":"6文献阅读与引用\/plugin_style.html","attributes":{"data-id":"plugin_style"},"menu":{"hasChildren":false},"tocID":"plugin_style-d895e752","next":"plugin_style-d895e752"}]}};